import React from 'react';
import Header from './components/Header';
import WelcomeSection from '../components/WelcomeSection';
import CardSection from '../components/cards';
import Footer from './components/Footer';

const Home = () => {
  return (
    <div>
      <Header />
      <WelcomeSection />
      <CardSection />
      <Footer />
    </div>
  );
};

export default Home;
